import HelloWorld from './components/HelloWorld'
import Header from './components/Header'
const routes = [
    {
        path: '/',
        name: 'hello',
        component: HelloWorld
    },
    {
        path: '/header',
        name: 'header',
        component: Header
    }

]

export default routes
